import styles from "./BonbonSummary.module.css";

const BonbonSummary = () => {
  return (
    <section className={styles.summary}>
      <h2>Wyjatkowe slodkosci na szczegolne momenty</h2>
      <p>Pracownia cukiernicza tworzaca wyjatkowe mono-desery.</p>
      <p>
        Kazdy product wykonujemy ze szczegolana uwaga oraz przy uzyciu
        najwyzszej jakosci swiezych, naturalnych skladnikow.
      </p>
    </section>
  );
};
export default BonbonSummary;
